import React from 'react';
import Card from '../UI/Card';
import AccountStatement from './AccountStatement';
import NavBar from '../Header/NavBar';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  NavLink,
} from "react-router-dom";

const DummyAccounts = [
	{id: "1", name:"Salman"},
	{id: "2", name:"Ali"},
	{id: "3", name:"Nobahar"}
];



function ListAccounts(props)	{

	return (
		<Card>
			{ <button onClick={props.logout}>Logout</button>}
			<Router>
					<NavBar link="/" account={{id: "1221",name:'All Accounts'}}/>			
				{   
					DummyAccounts.map(account => (
						<NavBar key={account.id} link={"/AccountStatement/" + account.name} account={account}/>
					))
				}
				<Routes>
							<Route exact path="/"   />
							<Route exact path="/AccountStatement/:accountId" element={<AccountStatement  />}  />
				</Routes>
			</Router>
		</Card>
	)
}

export default ListAccounts;
